column8:
しっくりと手になじみ、長時間編み続けていても疲れません。<br> 
厳選素材とクロバーの高い加工技術が生んだ<br>こだわりの逸品。<br>天然素材の持ち味を生かし、<br>1本1本ていねいに仕上げた高品質の竹あみ針です。<br>
<br>
<br><BR>●内容　2本1組<br><br>
≪材質≫　天然竹<BR><br>
<br><br><IMG src="http://image.rakuten.co.jp/peruru2/cabinet/order-change.gif" border="0"><DIV>


